#### FORWARD PROPAGATION
def sigmoid(Z):
    A = 1/(1+np.exp(-Z))
    cache = Z
    return A, cache

def relu(Z):
    A = np.maximum(0,Z)
    cache = Z
    return A, cache

def linear_forward(A, W, b):
    Z = W.dot(A) + b
    cache = (A, W, b)
    return Z, cache

def linear_activation_forward(A_prev, W, b, activation):
    if activation == "sigmoid":
        # Inputs: "A_prev, W, b". Outputs: "A, activation_cache".
        Z, linear_cache = linear_forward(A_prev, W, b)
        A, activation_cache = sigmoid(Z)
    elif activation == "relu":
        # Inputs: "A_prev, W, b". Outputs: "A, activation_cache".
        Z, linear_cache = linear_forward(A_prev, W, b)
        A, activation_cache = relu(Z)
    cache = (linear_cache, activation_cache)

    return A, cache

def L_model_forward(X, parameters):
    caches = []
    A = X
    L = len(parameters) // 2                  # number of layers in the neural network
    # Implement [LINEAR -> RELU]*(L-1). Add "cache" to the "caches" list.
    for l in range(1, L):
        A_prev = A
        A, cache = linear_activation_forward(A_prev, parameters['W' + str(l)], parameters['b' + str(l)], activation = "relu")
        caches.append(cache)
    # Implement LINEAR -> SIGMOID. Add "cache" to the "caches" list.
    AL, cache = linear_activation_forward(A, parameters['W' + str(L)], parameters['b' + str(L)], activation = "sigmoid")
    caches.append(cache)
    return AL, caches

def predict(X, parameters):
    m = X.shape[1]
    n = len(parameters) // 2 # number of layers in the neural network
    p = np.zeros((1,m))
    # Forward propagation
    probas, caches = L_model_forward(X, parameters)

    if probas[0, 0] > 0.5:
        p = 1
    else:
        p = 0
    return p, probas[0, 0]

#### Helper Functions
def find_most_recent(date, frame = gnp):
    for i in range(len(frame)):
        asof_date = frame.iloc[i].asof_date
        date = date.replace(tzinfo=None)
        if asof_date > date:
            latest = frame.iloc[i-1].value
            prev = frame.iloc[i-2].value
            pct_change = latest / prev - 1
            return pct_change

def find_most_recent_jobs(date):
    for i in range(len(jobs)):
        asof_date = jobs.iloc[i].asof_date
        date = date.replace(tzinfo=None)
        if asof_date > date:
            latest = jobs.iloc[i-1].total_private
            prev = jobs.iloc[i-2].total_private
            pct_change = latest / prev - 1
            return pct_change

def compute_returns(id, assets, close):
    idx = np.where(assets == id)
    prices = close.T[idx][0]
    start, end = prices[0], prices[24]
    result = end / start - 1
    return result

def compute_sector_returns(assets, close):
    # compute spy 1M return
    result = [ ]
    for i in range(len(all_ids)):
        id = all_ids[i]
        monthly_return = compute_returns(id, assets, close)
        result.append(monthly_return)
    return result

