#### Custom Factor
class TrainingData(CustomFactor):
    inputs = [USEquityPricing.close.latest]
    outputs = [
        "is_recommended",
        "predicted_return",
    ]
    window_length = LOOKBACK + 25
    def compute(self, today, assets, out, close):
        all_monthly_returns = compute_sector_returns(assets, close) # compute all sector 1M returns

        # compute macroeconomic data
        jobs_change = find_most_recent_jobs(today)
        gnp_change = find_most_recent(today, gnp)
        gdp_change = find_most_recent(today, gdp)
        inflation_change = find_most_recent(today, inflation)
        unemployment_change = find_most_recent(today, unemployment)
        macroeconomic = [ jobs_change, gnp_change, gdp_change, inflation_change, unemployment_change ]
        possible_features = macroeconomic + all_monthly_returns

        # iterate over all assets
        L = len(assets)
        for i in range(L):
            # determine lookback series of returns for asset
            asset = assets[i]
            is_recommended = 0
            predicted_return = 0
            if asset in working_ids:
                prices = close.T[i]
                series = [ ]
                for j in range(0, len(prices) - 25):
                    start = prices[j]
                    end = prices[j + 25]
                    r = start / end - 1
                    series = [r] + series
                X = []
                monthly_return = series[-1]
                X += series[:-1] # add time series
                feature_indices = features[str(asset)]
                for j in range(len(feature_indices)):
                    idx = feature_indices[j]
                    X.append(possible_features[idx])
                X.append(monthly_return)
                n = len(X)
                X = np.array(X)
                X = X.reshape((n, 1))
                parameters = get_params(asset)

                prediction, proba = predict(X, parameters)
                is_recommended = prediction
                predicted_return = proba
            out.is_recommended[i] = is_recommended
            out.predicted_return[i] = predicted_return


def initialize(context):
    """
    Called once at the start of the algorithm.
    """
    # Rebalance every day, 1 hour after market open.
    schedule_function(my_rebalance, date_rules.every_day(), time_rules.market_open(hours=1))

    # Record tracking variables at the end of each day.
    schedule_function(my_record_vars, date_rules.every_day(), time_rules.market_close())

    # Create our dynamic stock selector.
    attach_pipeline(make_pipeline(), 'my_pipeline')

def make_pipeline():
    """
    A function to create our dynamic stock selector (pipeline). Documentation on
    pipeline can be found here: https://www.quantopian.com/help#pipeline-title
    """

    # Base universe set to the Q1500US
    my_etfs = StaticAssets(symbols(['XLK', 'XLF', 'XLE', 'XLY', 'XLP', 'XLB', 'XLU', 'XLI', 'VNQ', 'VOX', 'XLV']))
    close = USEquityPricing.close.latest
    pipe = Pipeline(
        columns = {
            "close": close,
        },
        screen = my_etfs
    )

    monthly_return = Returns(inputs=[USEquityPricing.close], window_length=25)
    is_recommended, predicted_return = TrainingData(inputs=[USEquityPricing.close], window_length = LOOKBACK + 25)
    pipe.add(monthly_return, "monthly_return")
    pipe.add(is_recommended, "is_recommended")
    pipe.add(predicted_return, "predicted_return")
    return pipe

